pageDataArray[5] = [0,'Symbols Used in this Manual','symbolsusedinthismanual','Various symbols are used throughout this manual either to provide additional information on a specific topic or to warn of possible danger present during a procedure or an action. Be aware of all symbols when they are used, and always read NOTE, CAUTION, or WARNING messages. WARNING / 警告 Indicates an operating or maintenance procedure, practice or condition that, if not strictly observed, could result in injury or loss of life. Caution / 注意 Indicates an operating or maintenance procedure, practice, or condition that, if not strictly observed, could result in damage to, or destruction of, equipment. Check Point / チェックポイント May indicate an operating or maintenance procedure, practice or condition that is necessary to accomplish a task efficiently. It may also provide additional information that is related to a specific subject, or comment on the results achieved through a previous action. Assembly / 組み立て Indicates that a particular task must be carried out according to a certain standard after disassembly and before re-assembly, otherwise the quality of the components in question may be adversely affected. Lubrication / 注油 Indicates that lubrication is needed for the parts after disassembly, when doing a maintenance or replacing a part with a new one.','varioussymbolsareusedthroughoutthismanualeithertoprovideadditionalinformationonaspecifictopicortowarnofpossibledangerpresentduringaprocedureoranaction.beawareofallsymbolswhentheyareused,andalwaysreadnote,caution,orwarningmessages.warning/警告indicatesanoperatingormaintenanceprocedure,practiceorconditionthat,ifnotstrictlyobserved,couldresultininjuryorlossoflife.caution/注意indicatesanoperatingormaintenanceprocedure,practice,orconditionthat,ifnotstrictlyobserved,couldresultindamageto,ordestructionof,equipment.checkpoint/チェックポイントmayindicateanoperatingormaintenanceprocedure,practiceorconditionthatisnecessarytoaccomplishataskefficiently.itmayalsoprovideadditionalinformationthatisrelatedtoaspecificsubject,orcommentontheresultsachievedthroughapreviousaction.assembly/組み立てindicatesthataparticulartaskmustbecarriedoutaccordingtoacertainstandardafterdisassemblyandbeforere-assembly,otherwisethequalityofthecomponentsinquestionmaybeadverselyaffected.lubrication/注油indicatesthatlubricationisneededforthepartsafterdisassembly,whendoingamaintenanceorreplacingapartwithanewone.','24183031.html'];
