pageDataArray[7] = [0,'Product Descriptions','productdescriptions','Product Specification Wide application Double side print function. (when using optional ASF Unit, able to print multi pages) Realized media abrasion resistance that can correspond to photobook (double-sided photo). Smart design Lighter and smaller design than SL-D800. Able to use Epson Cloud Solution PORT Adopt new heater. Low operating sounds and low power consumption. Integrated eject tray and Scrap Paper Box. Usability Application for smart device such as smart phone and tablet. New nozzle detection technology. Ink is supplied from ink packs and the frequency of ink replacement is reduced. Easy operation from LCD panel is possible, and usability is improved. Continuous printing (up to 100 sheets) is possible (when using optional ASF Unit) User replaceable "Pickup Roller" and "Retard Roller", and improved maintainability. Modification Points from SL-D800 Series Items SL-D1000 Series SL-D800 Series Ink capacity 250ml (ink pack) 200ml (ink cartridge) Double side print Yes (when using optional ASF Unit, able to print multi pages) No LCD panel Yes No Nozzle check system Nozzle detection using CIS Module Nozzle detection by AID Board Nozzle detection by AID Board Interface USB/Wired LAN/Wireless LAN USB','productspecificationwideapplicationdoublesideprintfunction.(whenusingoptionalasfunit,abletoprintmultipages)realizedmediaabrasionresistancethatcancorrespondtophotobook(double-sidedphoto).smartdesignlighterandsmallerdesignthansl-d800.abletouseepsoncloudsolutionportadoptnewheater.lowoperatingsoundsandlowpowerconsumption.integratedejecttrayandscrappaperbox.usabilityapplicationforsmartdevicesuchassmartphoneandtablet.newnozzledetectiontechnology.inkissuppliedfrominkpacksandthefrequencyofinkreplacementisreduced.easyoperationfromlcdpanelispossible,andusabilityisimproved.continuousprinting(upto100sheets)ispossible(whenusingoptionalasfunit)userreplaceable"pickuproller"and"retardroller",andimprovedmaintainability.modificationpointsfromsl-d800seriesitemssl-d1000seriessl-d800seriesinkcapacity250ml(inkpack)200ml(inkcartridge)doublesideprintyes(whenusingoptionalasfunit,abletoprintmultipages)nolcdpanelyesnonozzlechecksystemnozzledetectionusingcismodulenozzledetectionbyaidboardnozzledetectionbyaidboardinterfaceusb/wiredlan/wirelesslanusb','23657989.html'];
