pageDataArray[12] = [0,'Panel Specifications','panelspecifications','Describes how to start the printer in special modes such as repair mode and program update mode. After starting the printer in ID input mode, input the corresponding ID to enter the special mode. Check Point / チェックポイント The special mode startup procedure differs depending on the firmware version. Check the firmware version of the printer and perform the corresponding steps. Procedure when the firmware version is SK16MC or later Repair mode With the printer turned off, press and hold the power button (A) while pressing and holding the home button (B), left button (C), and return button (D). Program update mode With the printer turned off, press and hold the power button (A) while pressing and holding the home button (B), right button (C), and down button (D). Procedure when the firmware version is SK10M8 or earlier With the printer turned off, press and hold the power button (A) while pressing and holding the OK button (B). When following screen is displayed on the LCD, release your fingers from the buttons. Press the up button (A) or the down button (B), and enter the number from 1 to 9. Press the right button (C), and go to the next digit. Repeat steps above, and enter specified ID. Repair mode: 39952 Program update mode: 11 After entering all ID, press the OK button (D). Press the OK button (D) when the confirmation message is displayed. To enter the ID again, press the right button (C). Check Point / チェックポイント OK button (D) will be enabled when 2 or more digits number is entered. After moved the digit by pressing the right button (C), going back to the previous digit is unavailable. When correction is necessary, press the OK button (D) after entering 2 or more digits, and press the right button (C) and enter the ID from the first digit when the confirmation message is displayed. The firmware version before SK10M8 is as follows. SK17LB SK17M2 SK09M3 SK25M4 SK12M5 SK28M6 SK10M8','describeshowtostarttheprinterinspecialmodessuchasrepairmodeandprogramupdatemode.afterstartingtheprinterinidinputmode,inputthecorrespondingidtoenterthespecialmode.checkpoint/チェックポイントthespecialmodestartupprocedurediffersdependingonthefirmwareversion.checkthefirmwareversionoftheprinterandperformthecorrespondingsteps.procedurewhenthefirmwareversionissk16mcorlaterrepairmodewiththeprinterturnedoff,pressandholdthepowerbutton(a)whilepressingandholdingthehomebutton(b),leftbutton(c),andreturnbutton(d).programupdatemodewiththeprinterturnedoff,pressandholdthepowerbutton(a)whilepressingandholdingthehomebutton(b),rightbutton(c),anddownbutton(d).procedurewhenthefirmwareversionissk10m8orearlierwiththeprinterturnedoff,pressandholdthepowerbutton(a)whilepressingandholdingtheokbutton(b).whenfollowingscreenisdisplayedonthelcd,releaseyourfingersfromthebuttons.presstheupbutton(a)orthedownbutton(b),andenterthenumberfrom1to9.presstherightbutton(c),andgotothenextdigit.repeatstepsabove,andenterspecifiedid.repairmode:39952programupdatemode:11afterenteringallid,presstheokbutton(d).presstheokbutton(d)whentheconfirmationmessageisdisplayed.toentertheidagain,presstherightbutton(c).checkpoint/チェックポイントokbutton(d)willbeenabledwhen2ormoredigitsnumberisentered.aftermovedthedigitbypressingtherightbutton(c),goingbacktothepreviousdigitisunavailable.whencorrectionisnecessary,presstheokbutton(d)afterentering2ormoredigits,andpresstherightbutton(c)andentertheidfromthefirstdigitwhentheconfirmationmessageisdisplayed.thefirmwareversionbeforesk10m8isasfollows.sk17lbsk17m2sk09m3sk25m4sk12m5sk28m6sk10m8','23657967.html'];
