pageDataArray[122] = [0,'CR Encoder Assy','crencoderassy','Pull the tabs to remove the Paper Feed Unit (A). Remove the Printer Cover (A) by sliding it in the direction of the arrow. Remove the 4 screws, and then remove the Upper Cover (A). : Silver/M3x10/Bind P-tite screw Lubrication / 注油 Before installation, refer to the following and carry out lubrication. Lubrication Remove the 4 screws, and then remove the CR Cover (A). : Black/M3x8/Bind S-tite screw Turn the gear (A) of the Pump Cap Unit counter-clockwise to unlock the CR Unit. Check Point / チェックポイント To lock the CR Unit, move the CR Unit (A) up to the contact position on the Home side, and then turn the gear of the Pump Cap Unit clockwise. After rotation, move the CR unit to the full side by about 2 mm to lock the CR unit. Remove the single screw, and then remove the CR Scale Holder (A). : Silver/M3x6/Cup S-tite screw Remove the CR Scale (A) from the hook (B) of the CR Scale Holder, and then remove the CR Scale Holder (C). Assembly / 組み立て Install the CR Scale Holder according to the procedure given below. Attach the CR Scale (A) on to the hook (B) of the CR Scale Holder, install the CR Scale Holder (C) and temporarily tighten it. Adjust the position of the CR Scale Holder (C) so that the CR Scale (A) does not come in contact with the CR Encoder (B). Fully tighten the screw to secure the CR Scale Holder (A). Remove the Torsion Spring (B) from the CR Scale (A), and then remove the CR Scale (A) from the hook (C) of the frame. Caution / 注意 Do not touch the surface of the CR Scale. Also, handle it with care so as not to soil or damage it. Pull out the CR Scale (A) from the rear side (B) of the CR Unit, and then remove the CR Scale. Assembly / 組み立て Install the CR Scale (A) such that the cut portion (B) faces down on the Home side. When passing the CR Scale (A) to the rear side of the CR Unit, pass it through the slit of the CR Encoder (B). Remove the single screw, and then remove the CR Stopper (A). : Silver/M3x6/Bind S-tite screw Assembly / 組み立て Install the CR Stopper (A) so that it touches the Driven Pulley Holder (B) and there is no gap in between. Move the CR Unit (A) to near the center. Push the Driven Pulley Holder (A) from the Full side so that the CR Timing Belt (B) gets warped, and then remove the CR Timing Belt from the Pinion Gear (C) of the CR Motor. Disengage the hook and remove the cable from the relay connector (A). Remove the 2 screws and then remove the CR Motor (A). : Silver/M3x4/Cup S-tite screw Assembly / 組み立て Install the CR Motor (A) so that the red dot on the rear side comes to the upper side. Remove the 2 screws securing the Right Cover (A). : Silver/M3x10/Bind P-tite screw Lift the Right Cover (A) in the direction of the arrow, disengage the 7 hooks (B), and then remove the Right Cover. Remove the single screw, and then remove the CR Stopper (A). : Silver/M3x6/Cup S-tite screw Remove all the FFC from the connector of the CR Relay Board (A). Move the CR Unit (A) to near the center. Caution / 注意 Secure the PW Sensor FFC to the CR Unit (C) with a tape, etc. so that the terminal of the PW Sensor FFC (A) does not come in contact with the ink containing absorption material of the Platen Assy (B). Disengage the hook (A) and remove the FFC Guide Sheet (B). Assembly / 組み立て Install the FFC Guide Sheet (A) so that the reference surface (B) touches the hook (C). Remove the CR FFC (A) from the slit (B) of the CR Unit. Peel off the double-sided tape (A), and remove the CR FFC (B) from the hook (C) of the CR Unit. Remove the 4 screws securing the Damper Assy (A). : Silver/M2.5x8/Bind S-tite screw : Silver/M3x10/Bind P-tite screw Lift the Damper Assy (A) straight up in the direction of the arrow to remove. Caution / 注意 When the Damper Assy (A) is removed, ink may flow down from the connecting port (B) of the Printhead. Therefore, keep rags handy in advance to prevent the surroundings from getting soiled. Remove the CR Timing Belt (B) from the Driven Pulley (A). Move the CR Unit (A) up to the position from where the rear side can be seen. Remove the 4 screws, and then remove the PG Cam Assy (A). : Silver/M3x8/Bind P-tite screw : Silver/M3x10/Bind P-tite screw Remove the CR Slider (A). Remove the single screw, and then remove the CR Encoder Cover (A). : Silver/M3x10/Bind P-tite screw Remove the 2 screws securing the CR Encoder Assy (A). : Silver/M1.7x5/Cup P-tite screw Remove the FFC from the connector (A) of CR Encoder Assy, and remove the CR Encoder Assy (B).','pullthetabstoremovethepaperfeedunit(a).removetheprintercover(a)byslidingitinthedirectionofthearrow.removethe4screws,andthenremovetheuppercover(a).:silver/m3x10/bindp-titescrewlubrication/注油beforeinstallation,refertothefollowingandcarryoutlubrication.lubricationremovethe4screws,andthenremovethecrcover(a).:black/m3x8/binds-titescrewturnthegear(a)ofthepumpcapunitcounter-clockwisetounlockthecrunit.checkpoint/チェックポイントtolockthecrunit,movethecrunit(a)uptothecontactpositiononthehomeside,andthenturnthegearofthepumpcapunitclockwise.afterrotation,movethecrunittothefullsidebyabout2mmtolockthecrunit.removethesinglescrew,andthenremovethecrscaleholder(a).:silver/m3x6/cups-titescrewremovethecrscale(a)fromthehook(b)ofthecrscaleholder,andthenremovethecrscaleholder(c).assembly/組み立てinstallthecrscaleholderaccordingtotheproceduregivenbelow.attachthecrscale(a)ontothehook(b)ofthecrscaleholder,installthecrscaleholder(c)andtemporarilytightenit.adjustthepositionofthecrscaleholder(c)sothatthecrscale(a)doesnotcomeincontactwiththecrencoder(b).fullytightenthescrewtosecurethecrscaleholder(a).removethetorsionspring(b)fromthecrscale(a),andthenremovethecrscale(a)fromthehook(c)oftheframe.caution/注意donottouchthesurfaceofthecrscale.also,handleitwithcaresoasnottosoilordamageit.pulloutthecrscale(a)fromtherearside(b)ofthecrunit,andthenremovethecrscale.assembly/組み立てinstallthecrscale(a)suchthatthecutportion(b)facesdownonthehomeside.whenpassingthecrscale(a)totherearsideofthecrunit,passitthroughtheslitofthecrencoder(b).removethesinglescrew,andthenremovethecrstopper(a).:silver/m3x6/binds-titescrewassembly/組み立てinstallthecrstopper(a)sothatittouchesthedrivenpulleyholder(b)andthereisnogapinbetween.movethecrunit(a)tonearthecenter.pushthedrivenpulleyholder(a)fromthefullsidesothatthecrtimingbelt(b)getswarped,andthenremovethecrtimingbeltfromthepiniongear(c)ofthecrmotor.disengagethehookandremovethecablefromtherelayconnector(a).removethe2screwsandthenremovethecrmotor(a).:silver/m3x4/cups-titescrewassembly/組み立てinstallthecrmotor(a)sothatthereddotontherearsidecomestotheupperside.removethe2screwssecuringtherightcover(a).:silver/m3x10/bindp-titescrewlifttherightcover(a)inthedirectionofthearrow,disengagethe7hooks(b),andthenremovetherightcover.removethesinglescrew,andthenremovethecrstopper(a).:silver/m3x6/cups-titescrewremovealltheffcfromtheconnectorofthecrrelayboard(a).movethecrunit(a)tonearthecenter.caution/注意securethepwsensorffctothecrunit(c)withatape,etc.sothattheterminalofthepwsensorffc(a)doesnotcomeincontactwiththeinkcontainingabsorptionmaterialoftheplatenassy(b).disengagethehook(a)andremovetheffcguidesheet(b).assembly/組み立てinstalltheffcguidesheet(a)sothatthereferencesurface(b)touchesthehook(c).removethecrffc(a)fromtheslit(b)ofthecrunit.peeloffthedouble-sidedtape(a),andremovethecrffc(b)fromthehook(c)ofthecrunit.removethe4screwssecuringthedamperassy(a).:silver/m2.5x8/binds-titescrew:silver/m3x10/bindp-titescrewliftthedamperassy(a)straightupinthedirectionofthearrowtoremove.caution/注意whenthedamperassy(a)isremoved,inkmayflowdownfromtheconnectingport(b)oftheprinthead.therefore,keepragshandyinadvancetopreventthesurroundingsfromgettingsoiled.removethecrtimingbelt(b)fromthedrivenpulley(a).movethecrunit(a)uptothepositionfromwheretherearsidecanbeseen.removethe4screws,andthenremovethepgcamassy(a).:silver/m3x8/bindp-titescrew:silver/m3x10/bindp-titescrewremovethecrslider(a).removethesinglescrew,andthenremovethecrencodercover(a).:silver/m3x10/bindp-titescrewremovethe2screwssecuringthecrencoderassy(a).:silver/m1.7x5/cupp-titescrewremovetheffcfromtheconnector(a)ofcrencoderassy,andremovethecrencoderassy(b).','23657900.html'];
