pageDataArray[130] = [0,'Decompression Pump','decompressionpump','Adjustment / 調整 When replacing/removing this part, refer the following pages and make sure to perform the specified operations including required adjustment. Adjustment Items and the Order by Repaired Part Pull the tabs to remove the Paper Feed Unit (A). Remove the Printer Cover (A) by sliding it in the direction of the arrow. Remove the 4 screws, and then remove the Upper Cover (A). : Silver/M3x10/Bind P-tite screw Lubrication / 注油 Before installation, refer to the following and carry out lubrication. Lubrication Remove the 2 screws securing the Right Cover (A). : Silver/M3x10/Bind P-tite screw Lift the Right Cover (A) in the direction of the arrow, disengage the 7 hooks (B), and then remove the Right Cover. Remove the Ink Tube (B) from the hook (A) of the Tube Clamp. Pull out the Tube Clamp (B) upwards to remove it while disengaging the hook (A) in the direction of the arrow. Remove the 2 cables from the hook (A) of the Power Supply Connector Assy. Remove the 3 screws, then remove the Power Supply Connector Assy (A). : Silver/M3x10/Bind P-tite screw Assembly / 組み立て Install the Power Supply Connector Assy (B) with the relay connector (A) pulled out, so that the relay connector (A) does not get caught in it. Remove the 2 screws and then remove the Tube Securing Cover (A). : Silver/M3x10/Bind P-tite screw Assembly / 組み立て Install so that the Ink Tube (B) fits below the 2 ribs (A) of the Tube Securing Cover. Disengage the hook and remove the cable (B) from the relay connector (A). Remove the tube (B) from the 2 hooks (A) of the Pump Cap Unit. Remove the tube (A) of the Decompression Pump from the joint (B) of the Ink Pack Holder Right Assy and pull out the tube. Assembly / 組み立て Pass the tube (A) of the Decompression Pump along the route shown in the figure and insert it firmly till the base of the joint (B). Remove the 4 screws, and then remove the Decompression Pump (A). : Silver/M3x12/P-tite screw with built-in washer : Silver/M3x10/Bind P-tite screw Assembly / 組み立て Install the Decompression Pump such that the CR Motor Earth Plate (B) is on the outer side of the grounding plate (A).','adjustment/調整whenreplacing/removingthispart,referthefollowingpagesandmakesuretoperformthespecifiedoperationsincludingrequiredadjustment.adjustmentitemsandtheorderbyrepairedpartpullthetabstoremovethepaperfeedunit(a).removetheprintercover(a)byslidingitinthedirectionofthearrow.removethe4screws,andthenremovetheuppercover(a).:silver/m3x10/bindp-titescrewlubrication/注油beforeinstallation,refertothefollowingandcarryoutlubrication.lubricationremovethe2screwssecuringtherightcover(a).:silver/m3x10/bindp-titescrewlifttherightcover(a)inthedirectionofthearrow,disengagethe7hooks(b),andthenremovetherightcover.removetheinktube(b)fromthehook(a)ofthetubeclamp.pulloutthetubeclamp(b)upwardstoremoveitwhiledisengagingthehook(a)inthedirectionofthearrow.removethe2cablesfromthehook(a)ofthepowersupplyconnectorassy.removethe3screws,thenremovethepowersupplyconnectorassy(a).:silver/m3x10/bindp-titescrewassembly/組み立てinstallthepowersupplyconnectorassy(b)withtherelayconnector(a)pulledout,sothattherelayconnector(a)doesnotgetcaughtinit.removethe2screwsandthenremovethetubesecuringcover(a).:silver/m3x10/bindp-titescrewassembly/組み立てinstallsothattheinktube(b)fitsbelowthe2ribs(a)ofthetubesecuringcover.disengagethehookandremovethecable(b)fromtherelayconnector(a).removethetube(b)fromthe2hooks(a)ofthepumpcapunit.removethetube(a)ofthedecompressionpumpfromthejoint(b)oftheinkpackholderrightassyandpulloutthetube.assembly/組み立てpassthetube(a)ofthedecompressionpumpalongtherouteshowninthefigureandinsertitfirmlytillthebaseofthejoint(b).removethe4screws,andthenremovethedecompressionpump(a).:silver/m3x12/p-titescrewwithbuilt-inwasher:silver/m3x10/bindp-titescrewassembly/組み立てinstallthedecompressionpumpsuchthatthecrmotorearthplate(b)isontheoutersideofthegroundingplate(a).','23657923.html'];
