pageDataArray[262] = [0,'Cut Position Adjustment','cutpositionadjustment','Required Tool SureLab Photo Paper Gloss (250) 210 mm Roll Paper Scale or Scale Loupe (10 magnifications) Estimate Time Approx. 10 min. Startup Mode Repair mode Standard Values 5.0 ± 3.0 mm (average) Procedure Refer below to start the printer in repair mode. Panel Specifications Set the paper. Start the Service Program, and select [Cut Position Adjustment]. Click the [Print] button to print the adjustment pattern. Measure the distance at 3 points (home side, center, full side) from the edge of the paper to the printed lines indicate in the figure in unit of 0.1 mm. Check the measured value is in the range of the standard value. In the range of the standard value: finish adjustment. Not in the range of the standard value: select the biggest value and the smallest value from the measured values, input them in the input field, and click the [Input] button. Go back to step 4, and check the adjustment pattern again.','requiredtoolsurelabphotopapergloss(250)210mmrollpaperscaleorscaleloupe(10magnifications)estimatetimeapprox.10min.startupmoderepairmodestandardvalues5.0±3.0mm(average)procedurereferbelowtostarttheprinterinrepairmode.panelspecificationssetthepaper.starttheserviceprogram,andselect[cutpositionadjustment].clickthe[print]buttontoprinttheadjustmentpattern.measurethedistanceat3points(homeside,center,fullside)fromtheedgeofthepapertotheprintedlinesindicateinthefigureinunitof0.1mm.checkthemeasuredvalueisintherangeofthestandardvalue.intherangeofthestandardvalue:finishadjustment.notintherangeofthestandardvalue:selectthebiggestvalueandthesmallestvaluefromthemeasuredvalues,inputthemintheinputfield,andclickthe[input]button.gobacktostep4,andchecktheadjustmentpatternagain.','23658250.html'];
pageDataArray[263] = [0,'T&B&S Check & Adjustment','t&b&scheck&adjustment','Required Tool SureLab Photo Paper Gloss - DS(225) A4 Cut Sheet Scale or Scale Loupe (10 magnifications) Estimate Time Approx. 10 min. Startup Mode Repair mode Standard Values TOP: 5.0 ± 0.2 mm LEFT: 5.0 ± 0.2 mm RIGHT: 5.0 ± 0.2 mm BOTTOM: 5.0 ± 0.2 mm Procedure Refer below to start the printer in repair mode. Panel Specifications If roll paper is set, remove it. Set paper to the paper slot of the Paper Feed Unit. Start the Service Program, and select [T&B&S Check & Adjustment]. Click the [Print] button to print the adjustment pattern. From the 4 lines (Top/Left/Right/Bottom) in the printed adjustment pattern, input the number of the line printed 5 mm from each edge of the paper in input fields, or set by clicking the arrow on upper and lower sides of the input fields. (Blue arrow indicates the paper feeding direction.) Click the [Input] button to write the adjustment value. Click the [Print] button again to print the adjustment pattern, and check that each 0 lines of Top/Left/Right/Bottom are within the standard value from the edges of the paper. If not, try again from step 5.','requiredtoolsurelabphotopapergloss-ds(225)a4cutsheetscaleorscaleloupe(10magnifications)estimatetimeapprox.10min.startupmoderepairmodestandardvaluestop:5.0±0.2mmleft:5.0±0.2mmright:5.0±0.2mmbottom:5.0±0.2mmprocedurereferbelowtostarttheprinterinrepairmode.panelspecificationsifrollpaperisset,removeit.setpapertothepaperslotofthepaperfeedunit.starttheserviceprogram,andselect[t&b&scheck&adjustment].clickthe[print]buttontoprinttheadjustmentpattern.fromthe4lines(top/left/right/bottom)intheprintedadjustmentpattern,inputthenumberofthelineprinted5mmfromeachedgeofthepaperininputfields,orsetbyclickingthearrowonupperandlowersidesoftheinputfields.(bluearrowindicatesthepaperfeedingdirection.)clickthe[input]buttontowritetheadjustmentvalue.clickthe[print]buttonagaintoprinttheadjustmentpattern,andcheckthateach0linesoftop/left/right/bottomarewithinthestandardvaluefromtheedgesofthepaper.ifnot,tryagainfromstep5.','23658213.html'];
pageDataArray[264] = [0,'PE Sensor Adjustment','pesensoradjustment','Required Tool SureLab Photo Paper Gloss - DS(225) A4 Cut Sheet Estimate Time Approx. 5 min. Startup Mode Repair mode Standard Values --- Procedure Refer below to start the printer in repair mode. Panel Specifications If roll paper is set, remove it. Inset the paper (A) in the paper slot of the Paper Feed Unit. Move the Edge Guide inward to adjust with paper width. While holding the Edge Guide, insert the paper (A) until it touches the PF Roller. Start the Service Program, and select [PE Sensor Adjustment]. Select With Paper and click the [Execute] button. Adjustment is performed and the adjustment value will be written. Remove the paper. Select Without Paper and click the [Execute] button. Adjustment is performed and the adjustment value will be written. Set the paper to the paper slot of the Paper Feed Unit. Select Top and click the [Execute] button. Paper is fed automatically, check the detection of the top of the paper, and the paper will be ejected. Set the paper to the paper slot of the Paper Feed Unit. Select Bottom and click the [Execute] button. Paper is fed automatically, check the detection of the bottom of the paper, and the paper will be ejected.','requiredtoolsurelabphotopapergloss-ds(225)a4cutsheetestimatetimeapprox.5min.startupmoderepairmodestandardvalues---procedurereferbelowtostarttheprinterinrepairmode.panelspecificationsifrollpaperisset,removeit.insetthepaper(a)inthepaperslotofthepaperfeedunit.movetheedgeguideinwardtoadjustwithpaperwidth.whileholdingtheedgeguide,insertthepaper(a)untilittouchesthepfroller.starttheserviceprogram,andselect[pesensoradjustment].selectwithpaperandclickthe[execute]button.adjustmentisperformedandtheadjustmentvaluewillbewritten.removethepaper.selectwithoutpaperandclickthe[execute]button.adjustmentisperformedandtheadjustmentvaluewillbewritten.setthepapertothepaperslotofthepaperfeedunit.selecttopandclickthe[execute]button.paperisfedautomatically,checkthedetectionofthetopofthepaper,andthepaperwillbeejected.setthepapertothepaperslotofthepaperfeedunit.selectbottomandclickthe[execute]button.paperisfedautomatically,checkthedetectionofthebottomofthepaper,andthepaperwillbeejected.','23658200.html'];
pageDataArray[265] = [0,'RE Sensor Adjustment','resensoradjustment','Required Tool SureLab Photo Paper Gloss - DS(225) A4 Cut Sheet Estimate Time Approx. 2 min. Startup Mode Repair mode Standard Values --- Procedure Refer below to start the printer in repair mode. Panel Specifications Remove the Scrap Paper Box. If roll paper is set, remove it. Insert the paper (A) in the paper slot (B). Move the Edge Guide (C) inward to adjust with paper width. While holding the Edge Guide (C), insert paper for about 80 mm. Install the Scrap Paper Box. Start the Service Program, and select [RE Sensor Adjustment]. Select With Paper and click the [Execute] button to perform adjustment. Remove the paper (A). Select Without Paper and click the [Execute] button to perform adjustment.','requiredtoolsurelabphotopapergloss-ds(225)a4cutsheetestimatetimeapprox.2min.startupmoderepairmodestandardvalues---procedurereferbelowtostarttheprinterinrepairmode.panelspecificationsremovethescrappaperbox.ifrollpaperisset,removeit.insertthepaper(a)inthepaperslot(b).movetheedgeguide(c)inwardtoadjustwithpaperwidth.whileholdingtheedgeguide(c),insertpaperforabout80mm.installthescrappaperbox.starttheserviceprogram,andselect[resensoradjustment].selectwithpaperandclickthe[execute]buttontoperformadjustment.removethepaper(a).selectwithoutpaperandclickthe[execute]buttontoperformadjustment.','23658206.html'];
pageDataArray[266] = [0,'PF Scale Check','pfscalecheck','Required Tool --- Estimate Time Approx. 1 min. Startup Mode Repair mode Standard Values --- Procedure Refer below to start the printer in repair mode. Panel Specifications If paper is set, remove it. Start the Service Program, and select [PF Scale Check]. By clicking the [Execute] button, PF Scale state check starts automatically. If error occurred, PF Scale may be contaminated or damaged. After cleaning the contamination of the PF Scale with ethanol or similar, click the Execute button to check again. If error occur after cleaning, replace the PF Scale, and check again.','requiredtool---estimatetimeapprox.1min.startupmoderepairmodestandardvalues---procedurereferbelowtostarttheprinterinrepairmode.panelspecificationsifpaperisset,removeit.starttheserviceprogram,andselect[pfscalecheck].byclickingthe[execute]button,pfscalestatecheckstartsautomatically.iferroroccurred,pfscalemaybecontaminatedordamaged.aftercleaningthecontaminationofthepfscalewithethanolorsimilar,clicktheexecutebuttontocheckagain.iferroroccuraftercleaning,replacethepfscale,andcheckagain.','23658175.html'];
pageDataArray[267] = [0,'PF Motor Measurement & Auto Adjustment','pfmotormeasurement&autoadjustment','Required Tool --- Estimate Time Approx. 1 min. Startup Mode Repair mode Standard Values --- Procedure Refer below to start the printer in repair mode. Panel Specifications If paper is set, remove it. Start the Service Program, and select [PF Motor Measurement & Auto Adjustment]. Click the [Execute] button. This automatically calculates the correction value, and writes this value to the printer. If [Failed] is displayed, then perform adjustment again. If this is still unsuccessful then replace the PF Motor.','requiredtool---estimatetimeapprox.1min.startupmoderepairmodestandardvalues---procedurereferbelowtostarttheprinterinrepairmode.panelspecificationsifpaperisset,removeit.starttheserviceprogram,andselect[pfmotormeasurement&autoadjustment].clickthe[execute]button.thisautomaticallycalculatesthecorrectionvalue,andwritesthisvaluetotheprinter.if[failed]isdisplayed,thenperformadjustmentagain.ifthisisstillunsuccessfulthenreplacethepfmotor.','23658209.html'];
