pageDataArray[270] = [0,'Heater Operation Check','heateroperationcheck','Required Tool Infrared Thermometer Check Point / チェックポイント Check is possible without an Infrared Thermometer. Estimate Time Approx. 5 min. Startup Mode Repair mode Standard Values Temperature around the printer installed place +5 ℃ or more, 80 ℃ or less (target: 30 ℃ or more) Procedure Refer below to start the printer in repair mode. Panel Specifications If paper is set, remove it. Start the Service Program, and select [Heater Operation Check]. Click the [Execute] button to turn on the Heater, and wait 90 seconds. Measure the temperature of the backside (full side) of the Control Panel (A) with the Infrared Thermometer, and check if the temperature is in the range of the standard value. Check Point / チェックポイント If there is no Infrared Thermometer, check the warm air is coming out from near the paper eject port (B) and the fans (C) on both sides are moving.','requiredtoolinfraredthermometercheckpoint/チェックポイントcheckispossiblewithoutaninfraredthermometer.estimatetimeapprox.5min.startupmoderepairmodestandardvaluestemperaturearoundtheprinterinstalledplace+5℃ormore,80℃orless(target:30℃ormore)procedurereferbelowtostarttheprinterinrepairmode.panelspecificationsifpaperisset,removeit.starttheserviceprogram,andselect[heateroperationcheck].clickthe[execute]buttontoturnontheheater,andwait90seconds.measurethetemperatureofthebackside(fullside)ofthecontrolpanel(a)withtheinfraredthermometer,andcheckifthetemperatureisintherangeofthestandardvalue.checkpoint/チェックポイントifthereisnoinfraredthermometer,checkthewarmairiscomingoutfromnearthepaperejectport(b)andthefans(c)onbothsidesaremoving.','23658217.html'];
pageDataArray[271] = [0,'Paper Set Line Switching Flag ON/OFF','papersetlineswitchingflagon/off','Required Tool --- Estimate Time Approx. 2 min. Startup Mode Repair mode Standard Values --- Procedure Refer below to start the printer in repair mode. Panel Specifications Start the Service Program, and select [Paper Set Line Switching Flag ON/OFF]. Click the [Confirm] button, and confirm the current flag status. Visually check the shape of the platen. A: With protrusion, select the flag ON B: No protrusion, select the flag OFF Select the flag ON/OFF with the radio button. Click the [Change] button to switch the flag.','requiredtool---estimatetimeapprox.2min.startupmoderepairmodestandardvalues---procedurereferbelowtostarttheprinterinrepairmode.panelspecificationsstarttheserviceprogram,andselect[papersetlineswitchingflagon/off].clickthe[confirm]button,andconfirmthecurrentflagstatus.visuallychecktheshapeoftheplaten.a:withprotrusion,selecttheflagonb:noprotrusion,selecttheflagoffselecttheflagon/offwiththeradiobutton.clickthe[change]buttontoswitchtheflag.','78610540.html'];
