pageDataArray[290] = [0,'CR Motor Measurement & Auto Adjustment','crmotormeasurement&autoadjustment','Required Tool --- Estimate Time Approx. 1 min. Startup Mode Repair mode Standard Values --- Procedure Refer below to start the printer in repair mode. Panel Specifications If paper is set, remove it. Start the Service Program, and select [CR Motor Measurement & Auto Adjustment]. Click the [Execute] button. This automatically calculates the correction value, and writes this value to the printer. If [Failed] is displayed, then perform adjustment again. If this is still unsuccessful then replace the CR Motor.','requiredtool---estimatetimeapprox.1min.startupmoderepairmodestandardvalues---procedurereferbelowtostarttheprinterinrepairmode.panelspecificationsifpaperisset,removeit.starttheserviceprogram,andselect[crmotormeasurement&autoadjustment].clickthe[execute]button.thisautomaticallycalculatesthecorrectionvalue,andwritesthisvaluetotheprinter.if[failed]isdisplayed,thenperformadjustmentagain.ifthisisstillunsuccessfulthenreplacethecrmotor.','23658359.html'];
