pageDataArray[296] = [0,'For i1/i1Pro/i1Pro2/i1Pro3','fori1/i1pro/i1pro2/i1pro3','Confirm that the M/C No. displayed on the main screen and the M/C No. written on the correction charts are the same. Make sure the color measurement device is connected with the PC and its power is on. Place the color measurement device (A) on the calibration base plate (B). Check Point / チェックポイント Place the chart on white paper if there is no backup board available for measurement. Click [Measure Calib Chart]. When the confirmation screen appears, click [Yes]. Place the correction chart that matches the color chart ID and preset ID displayed on the screen on the measurement backup board supplied with the color measurement device. Check Point / チェックポイント Place the chart on white paper if there is no backup board available for measurement. Set the chart on the measurement backup board as row A comes to the bottom side. Color measurement starts. Select Color Measurement Method. Select a [Line Scan] to perform color measurement for each line, or select [Spot Scan] to perform color measurement for each patch. Check Point / チェックポイント Select [Line Scan] to perform color measurement quickly. If the results of color measurement using [Line Scan] are not what you expected, try [Spot Scan]. When performing color measurement with [Line Scan], use the chart measurement ruler supplied with the color measurement device. When performing color measurement with [Spot Scan], use the spot measurement guide supplied with the color measurement device. Perform color measurement in the order of the range displayed on the screen. To change the scanning range, move by clicking the arrow buttons on the screen. When performing color measurement in [Line Scan], match the color measurement device to the measurement ruler being used, hold down the button on the side, and slowly move over the patch to scan. When performing color measurement with [Spot Scan], adjust the measurement guide so that it is over the target patch, place the color measurement device, and then press the button on the side. When reading is successful, the data is displayed on the screen where the correction chart is read. When reading fails, an “x” is displayed on the screen where the correction chart is read. In this case, try reading again. When color measurement is complete, click [OK]. Scan three sheets of correction chart in the same manner as step 3 to step 11. When the confirmation screen appears, click [OK].','confirmthatthem/cno.displayedonthemainscreenandthem/cno.writtenonthecorrectionchartsarethesame.makesurethecolormeasurementdeviceisconnectedwiththepcanditspowerison.placethecolormeasurementdevice(a)onthecalibrationbaseplate(b).checkpoint/チェックポイントplacethechartonwhitepaperifthereisnobackupboardavailableformeasurement.click[measurecalibchart].whentheconfirmationscreenappears,click[yes].placethecorrectionchartthatmatchesthecolorchartidandpresetiddisplayedonthescreenonthemeasurementbackupboardsuppliedwiththecolormeasurementdevice.checkpoint/チェックポイントplacethechartonwhitepaperifthereisnobackupboardavailableformeasurement.setthechartonthemeasurementbackupboardasrowacomestothebottomside.colormeasurementstarts.selectcolormeasurementmethod.selecta[linescan]toperformcolormeasurementforeachline,orselect[spotscan]toperformcolormeasurementforeachpatch.checkpoint/チェックポイントselect[linescan]toperformcolormeasurementquickly.iftheresultsofcolormeasurementusing[linescan]arenotwhatyouexpected,try[spotscan].whenperformingcolormeasurementwith[linescan],usethechartmeasurementrulersuppliedwiththecolormeasurementdevice.whenperformingcolormeasurementwith[spotscan],usethespotmeasurementguidesuppliedwiththecolormeasurementdevice.performcolormeasurementintheorderoftherangedisplayedonthescreen.tochangethescanningrange,movebyclickingthearrowbuttonsonthescreen.whenperformingcolormeasurementin[linescan],matchthecolormeasurementdevicetothemeasurementrulerbeingused,holddownthebuttonontheside,andslowlymoveoverthepatchtoscan.whenperformingcolormeasurementwith[spotscan],adjustthemeasurementguidesothatitisoverthetargetpatch,placethecolormeasurementdevice,andthenpressthebuttonontheside.whenreadingissuccessful,thedataisdisplayedonthescreenwherethecorrectionchartisread.whenreadingfails,an“x”isdisplayedonthescreenwherethecorrectionchartisread.inthiscase,tryreadingagain.whencolormeasurementiscomplete,click[ok].scanthreesheetsofcorrectionchartinthesamemannerasstep3tostep11.whentheconfirmationscreenappears,click[ok].','23658324.html'];
pageDataArray[297] = [0,'For i1 iSis','fori1isis','Confirm that the M/C No. displayed on the main screen and the M/C No. written on the correction charts are the same. Make sure the color measurement device is connected with the PC and its power is on. Click the [Measure Calib Chart] button. When the confirmation screen appears, click [Yes]. When the screen is displayed, check that the light (B) on the right of the color measurement device (A) is flashing green, and then insert the correction chart (C) that matches the color chart ID and preset ID displayed on the screen into the color measurement device. (When inserting the correction chart, align it to the left.) Check Point / チェックポイント If the following message appears, the chart you inserted is wrong. Click the [Cancel] button to abort the procedure. Color measurement starts. The measure color screen appears, and click [OK]. Scan three sheets of correction chart in the same manner as step 5 to step 7. When the confirmation screen appears, click [OK].','confirmthatthem/cno.displayedonthemainscreenandthem/cno.writtenonthecorrectionchartsarethesame.makesurethecolormeasurementdeviceisconnectedwiththepcanditspowerison.clickthe[measurecalibchart]button.whentheconfirmationscreenappears,click[yes].whenthescreenisdisplayed,checkthatthelight(b)ontherightofthecolormeasurementdevice(a)isflashinggreen,andtheninsertthecorrectionchart(c)thatmatchesthecolorchartidandpresetiddisplayedonthescreenintothecolormeasurementdevice.(wheninsertingthecorrectionchart,alignittotheleft.)checkpoint/チェックポイントifthefollowingmessageappears,thechartyouinsertediswrong.clickthe[cancel]buttontoaborttheprocedure.colormeasurementstarts.themeasurecolorscreenappears,andclick[ok].scanthreesheetsofcorrectionchartinthesamemannerasstep5tostep7.whentheconfirmationscreenappears,click[ok].','23658328.html'];
