pageDataArray[307] = [0,'Initial Ink Charge Flag On / Off','initialinkchargeflagon/off','Required Tool --- Estimate Time Approx. 1 min. Startup Mode Repair mode Standard Values --- Procedure Refer below to start the printer in repair mode. Panel Specifications Start the Service Program, and select [Initial Ink Charge Flag On / Off]. Click the [Confirm] button, and confirm the current flag status. Click the [Change] button to switch the flag. Check Point / チェックポイント When set the flag ON, Initial Ink Charge will be performed when the printer is turned on the next time. Turn off the printer.','requiredtool---estimatetimeapprox.1min.startupmoderepairmodestandardvalues---procedurereferbelowtostarttheprinterinrepairmode.panelspecificationsstarttheserviceprogram,andselect[initialinkchargeflagon/off].clickthe[confirm]button,andconfirmthecurrentflagstatus.clickthe[change]buttontoswitchtheflag.checkpoint/チェックポイントwhensettheflagon,initialinkchargewillbeperformedwhentheprinteristurnedonthenexttime.turnofftheprinter.','23658268.html'];
