pageDataArray[310] = [0,'CIS Module Reading Check','cismodulereadingcheck','Required Tool Grey Chart Jig Estimate Time Approx. 6 min. Startup Mode Repair mode Standard Values --- Procedure Refer below to start the printer in repair mode. Panel Specifications If roll paper is set, remove it. Start the Service Program, and select [CIS Module Reading Check]. Check Point / チェックポイント Check the Grey Chart Jig is not contaminated or damaged. When error occurs, check the following items. Plate of the Paper Feed Unit (A) is not contaminated. Reading surface of the CIS Module is not contaminated. Connection between the FFCs and the CIS Module have no problem. Set the Grey Chart Jig (A) to the Paper Feed Unit with the grey part of the Grey Chart Jig (A) directed to the feed port. Move the Edge Guide (B) inward according to the paper width. Insert the Grey Chart Jig (A) until it touches the PF Roller. Click the [Execute] button. Reading by the CIS Module starts, and adjustment is performed automatically.','requiredtoolgreychartjigestimatetimeapprox.6min.startupmoderepairmodestandardvalues---procedurereferbelowtostarttheprinterinrepairmode.panelspecificationsifrollpaperisset,removeit.starttheserviceprogram,andselect[cismodulereadingcheck].checkpoint/チェックポイントcheckthegreychartjigisnotcontaminatedordamaged.whenerroroccurs,checkthefollowingitems.plateofthepaperfeedunit(a)isnotcontaminated.readingsurfaceofthecismoduleisnotcontaminated.connectionbetweentheffcsandthecismodulehavenoproblem.setthegreychartjig(a)tothepaperfeedunitwiththegreypartofthegreychartjig(a)directedtothefeedport.movetheedgeguide(b)inwardaccordingtothepaperwidth.insertthegreychartjig(a)untilittouchesthepfroller.clickthe[execute]button.readingbythecismodulestarts,andadjustmentisperformedautomatically.','24182821.html'];
pageDataArray[311] = [0,'CIS Module Nozzle Missing Detection Check','cismodulenozzlemissingdetectioncheck','Required Tool SureLab Photo Paper Gloss (250) 210 mm Roll Paper Estimate Time Approx. 9 min. Startup Mode Repair mode Standard Values --- Procedure Refer below to start the printer in repair mode. Panel Specifications Start the Service Program, and select [CIS Module Nozzle Missing Detection Check]. Click the [Execute] button. After the nozzle check pattern is automatically printed, scan is performed by the CIS Module, and the result is displayed. If the error is displayed, nozzle missing of the Printhead may be occurring, so perform Cleaning and check if there is any missing nozzle, and then perform nozzle missing detection check again.','requiredtoolsurelabphotopapergloss(250)210mmrollpaperestimatetimeapprox.9min.startupmoderepairmodestandardvalues---procedurereferbelowtostarttheprinterinrepairmode.panelspecificationsstarttheserviceprogram,andselect[cismodulenozzlemissingdetectioncheck].clickthe[execute]button.afterthenozzlecheckpatternisautomaticallyprinted,scanisperformedbythecismodule,andtheresultisdisplayed.iftheerrorisdisplayed,nozzlemissingoftheprintheadmaybeoccurring,soperformcleaningandcheckifthereisanymissingnozzle,andthenperformnozzlemissingdetectioncheckagain.','24182816.html'];
pageDataArray[312] = [0,'CIS Module Remaining Media Barcode Reading Check','cismoduleremainingmediabarcodereadingcheck','Required Tool SureLab Photo Paper Gloss (250) 210 mm Roll Paper Estimate Time Approx. 4 min. Startup Mode Repair mode Standard Values --- Procedure Refer below to start the printer in repair mode. Panel Specifications Start the Service Program, and select [CIS Module Remaining Media Barcode Reading Check]. Click the [Execute] button. After the Barcode is printed automatically, scan is performed by the CIS Module, and the result is displayed. If error is displayed, barcode may not be printed correctly because of missing nozzle of the Printhead, so perform Cleaning and check if there is any missing nozzle, and then perform remaining media barcode reading check again.','requiredtoolsurelabphotopapergloss(250)210mmrollpaperestimatetimeapprox.4min.startupmoderepairmodestandardvalues---procedurereferbelowtostarttheprinterinrepairmode.panelspecificationsstarttheserviceprogram,andselect[cismoduleremainingmediabarcodereadingcheck].clickthe[execute]button.afterthebarcodeisprintedautomatically,scanisperformedbythecismodule,andtheresultisdisplayed.iferrorisdisplayed,barcodemaynotbeprintedcorrectlybecauseofmissingnozzleoftheprinthead,soperformcleaningandcheckifthereisanymissingnozzle,andthenperformremainingmediabarcodereadingcheckagain.','24182809.html'];
