pageDataArray[327] = [0,'Printhead Ground Resistance Check','printheadgroundresistancecheck','Required Tool Multimeter Estimate Time Approx. 3 min. Startup Mode --- Standard Values 100 Ω or less Procedure Caution / 注意 Make sure to perform when the printer is turned OFF. Also, make sure to unplug the AC Inlet. Be careful not to damage the nozzle surface of the Printhead with the terminal of the multimeter. Do not press the terminal of the multimeter too strong to the Head Cover. Remove the following parts in advance. Upper Cover Rotate the gear of the Pump Cap Unit (A) counterclockwise, and unlock the CR Unit. Measure the resistance by touching the frame (B) and the Head Cover (C) with the terminals of the multimeter (A), Check the resistance satisfies the standard value. If the measured resistance is out of standard, remove and attach the Printhead, and measure the resistance again.','requiredtoolmultimeterestimatetimeapprox.3min.startupmode---standardvalues100ωorlessprocedurecaution/注意makesuretoperformwhentheprinteristurnedoff.also,makesuretounplugtheacinlet.becarefulnottodamagethenozzlesurfaceoftheprintheadwiththeterminalofthemultimeter.donotpresstheterminalofthemultimetertoostrongtotheheadcover.removethefollowingpartsinadvance.uppercoverrotatethegearofthepumpcapunit(a)counterclockwise,andunlockthecrunit.measuretheresistancebytouchingtheframe(b)andtheheadcover(c)withtheterminalsofthemultimeter(a),checktheresistancesatisfiesthestandardvalue.ifthemeasuredresistanceisoutofstandard,removeandattachtheprinthead,andmeasuretheresistanceagain.','23658447.html'];
pageDataArray[328] = [0,'Initial Password Check & Input (EMEA only)','initialpasswordcheck&input(emeaonly)','Required Tool --- Estimate Time Approx. 1 min. Startup Mode Repair mode Standard Values --- Procedure Refer below to start the printer in repair mode. Panel Specifications Check Point / チェックポイント Before this adjustment, check if the password label is attached to the product. If it is not attached, skip this adjustment. Start the Service Program, and select [Initial Password Check & Input (EMEA only)]. Click the [Input] button, and write the initial password to the printer. (If you get an error, check if the entered value is correct) From the panel of the printer, execute [Settings] - [Restore Default Settings] - [Clear All Data and Settings], and restart the printer (password is set on the printer). Click the [Check] button and confirm that the initial password value displayed on the screen is the same as the value on the password label attached to the product.','requiredtool---estimatetimeapprox.1min.startupmoderepairmodestandardvalues---procedurereferbelowtostarttheprinterinrepairmode.panelspecificationscheckpoint/チェックポイントbeforethisadjustment,checkifthepasswordlabelisattachedtotheproduct.ifitisnotattached,skipthisadjustment.starttheserviceprogram,andselect[initialpasswordcheck&input(emeaonly)].clickthe[input]button,andwritetheinitialpasswordtotheprinter.(ifyougetanerror,checkiftheenteredvalueiscorrect)fromthepaneloftheprinter,execute[settings]-[restoredefaultsettings]-[clearalldataandsettings],andrestarttheprinter(passwordissetontheprinter).clickthe[check]buttonandconfirmthattheinitialpasswordvaluedisplayedonthescreenisthesameasthevalueonthepasswordlabelattachedtotheproduct.','148177151.html'];
pageDataArray[329] = [0,'Firmware Update','firmwareupdate','The firmware of this printer is written in the Main Board. If the Main Board is replaced or the firmware needs to be updated, follow the procedure below to write the firmware to the Main Board. Caution / 注意 Make sure not to turn off the printer until updating is complete. Otherwise, the printer may not operate normally. Printer update is not finished when “Finish” is displayed on the screen of firmware updater. When printer update is finished, screen displayed on the printer panel changes and ROM version screen will be displayed. Normal Firmware Update Procedure (Not Replacing the Main Board) Connect the Printer and PC with a USB cable. Turn the printer ON in normal mode. Start the Firmware updater (EPFWUPD.exe). When the Firmware updater has started, click [Next]. Read license agreement, select [I agree], and click [Next]. Click [Browse], select the firmware data which you install. Read the precautions displayed by clicking [Next], click [Next] again. The information of firmware updating and the printer connected currently isdisplayed. Check the check box, and click [Start] to start Firmware update. The printer automatically turns off and back on again when the update is finished. Click [Finish] of the firmware updater to finish. Firmware Update After Replacing the Main Board Remove the ink cartridge and Maintenance Box. Connect the Printer and PC with a USB cable. Refer below and start the printer in program update mode. Panel Specifications Confirm the “EPSON PRINTER ProgramUpdateMode” is displayed on LCD of the printer, and start firmware updater (EPFWUPD.exe). When the Firmware updater has started, click [Next]. Read license agreement, select [I agree], and click [Next]. Click [Browse], select the firmware data which you install. Read the precautions displayed by clicking [Next], click [Next] again. Information of the updating firmware is displayed. Check the check box that model name is “Unknown”, and click [Start] to start Firmware update. When update is finished, turn the printer off, and click [Finish] on the updater.','thefirmwareofthisprinteriswritteninthemainboard.ifthemainboardisreplacedorthefirmwareneedstobeupdated,followtheprocedurebelowtowritethefirmwaretothemainboard.caution/注意makesurenottoturnofftheprinteruntilupdatingiscomplete.otherwise,theprintermaynotoperatenormally.printerupdateisnotfinishedwhen“finish”isdisplayedonthescreenoffirmwareupdater.whenprinterupdateisfinished,screendisplayedontheprinterpanelchangesandromversionscreenwillbedisplayed.normalfirmwareupdateprocedure(notreplacingthemainboard)connecttheprinterandpcwithausbcable.turntheprinteroninnormalmode.startthefirmwareupdater(epfwupd.exe).whenthefirmwareupdaterhasstarted,click[next].readlicenseagreement,select[iagree],andclick[next].click[browse],selectthefirmwaredatawhichyouinstall.readtheprecautionsdisplayedbyclicking[next],click[next]again.theinformationoffirmwareupdatingandtheprinterconnectedcurrentlyisdisplayed.checkthecheckbox,andclick[start]tostartfirmwareupdate.theprinterautomaticallyturnsoffandbackonagainwhentheupdateisfinished.click[finish]ofthefirmwareupdatertofinish.firmwareupdateafterreplacingthemainboardremovetheinkcartridgeandmaintenancebox.connecttheprinterandpcwithausbcable.referbelowandstarttheprinterinprogramupdatemode.panelspecificationsconfirmthe“epsonprinterprogramupdatemode”isdisplayedonlcdoftheprinter,andstartfirmwareupdater(epfwupd.exe).whenthefirmwareupdaterhasstarted,click[next].readlicenseagreement,select[iagree],andclick[next].click[browse],selectthefirmwaredatawhichyouinstall.readtheprecautionsdisplayedbyclicking[next],click[next]again.informationoftheupdatingfirmwareisdisplayed.checkthecheckboxthatmodelnameis“unknown”,andclick[start]tostartfirmwareupdate.whenupdateisfinished,turntheprinteroff,andclick[finish]ontheupdater.','24182786.html'];
