pageDataArray[334] = [0,'Overview','overview','This section provides information on how to maintain the printer in its optimum operating condition. Basically, servicing on the printer should be performed on-site. Be sure to strictly observe the following precautions when servicing to avoid an accident or injury causing the user trouble. WARNING / 警告 The power switch is installed on the secondary side of the power circuit, so power is always supplied to the power supply circuit even when the switch is OFF unless the power cord is unplugged from the wall power outlet. Unless otherwise stated (for printing or operation checks), be sure to unplug the power cord from the wall outlet before disassembling or assembling the printer to prevent electric shock and damage to the circuit. The Front Sensor provided for detecting open/close status of the Printer Cover also acts as a safety interlock switch. Never disable the switch function to prevent possible injury. Caution / 注意 Be extremely careful not to get the ink into your eye or let it come into contact with your skin. If it happens, wash out your eye or skin with water immediately. If any abnormality is found, contact a physician.','thissectionprovidesinformationonhowtomaintaintheprinterinitsoptimumoperatingcondition.basically,servicingontheprintershouldbeperformedon-site.besuretostrictlyobservethefollowingprecautionswhenservicingtoavoidanaccidentorinjurycausingtheusertrouble.warning/警告thepowerswitchisinstalledonthesecondarysideofthepowercircuit,sopowerisalwayssuppliedtothepowersupplycircuitevenwhentheswitchisoffunlessthepowercordisunpluggedfromthewallpoweroutlet.unlessotherwisestated(forprintingoroperationchecks),besuretounplugthepowercordfromthewalloutletbeforedisassemblingorassemblingtheprintertopreventelectricshockanddamagetothecircuit.thefrontsensorprovidedfordetectingopen/closestatusoftheprintercoveralsoactsasasafetyinterlockswitch.neverdisabletheswitchfunctiontopreventpossibleinjury.caution/注意beextremelycarefulnottogettheinkintoyoureyeorletitcomeintocontactwithyourskin.ifithappens,washoutyoureyeorskinwithwaterimmediately.ifanyabnormalityisfound,contactaphysician.','23658002.html'];
pageDataArray[335] = [0,'Storing','storing','When not using the printer for a long time, to store it in the state with ink packs for all colors are installed and ink charged to the printer is recommended.','whennotusingtheprinterforalongtime,tostoreitinthestatewithinkpacksforallcolorsareinstalledandinkchargedtotheprinterisrecommended.','23658128.html'];
pageDataArray[336] = [0,'Moving and Transporting the Printer','movingandtransportingtheprinter','Caution / 注意 When lifting the printer, work in a posture that does not damage your body. When lifting the printer, hold it in the areas indicated below. The printer may fall if you lift it by holding other areas, and your fingers could be caught which may cause an injury. Also, place your hands so the front of the printer is facing your body, so the Scrap Paper Box does not accidently fall out. Check Point / チェックポイント Move/transport the printer while the ink packs/Maintenance Box are installed. If the ink packs are removed, the nozzles may clog so printing is not possible. Also, ink may leak from the Maintenance Box installing section or ink pack installing section. Since ink could leak out, do not tilt the product when moving or transporting it. Moving the Printer This section explains how to move the printer over short distances, such as to a different location within the same building. Make the following preparations in advance before moving the printer. Remove all paper from the printer. Close all covers and store the eject tray. Turn off the printer and remove all cables. Move the printer. Turn on the printer, perform nozzle check, and then perform cleaning if necessary. Transporting the Printer When transporting the printer, transport it while the ink packs/Maintenance Box are installed. If ink pack cannot be installed, attach the Transportation Cap (A) shown below on the Ink Pack Tray (B) when transporting the printer. Name ASP name ASP code Transportation Cap CAP,NEEDLE,INK PACK 1743970','caution/注意whenliftingtheprinter,workinaposturethatdoesnotdamageyourbody.whenliftingtheprinter,holditintheareasindicatedbelow.theprintermayfallifyouliftitbyholdingotherareas,andyourfingerscouldbecaughtwhichmaycauseaninjury.also,placeyourhandssothefrontoftheprinterisfacingyourbody,sothescrappaperboxdoesnotaccidentlyfallout.checkpoint/チェックポイントmove/transporttheprinterwhiletheinkpacks/maintenanceboxareinstalled.iftheinkpacksareremoved,thenozzlesmayclogsoprintingisnotpossible.also,inkmayleakfromthemaintenanceboxinstallingsectionorinkpackinstallingsection.sinceinkcouldleakout,donottilttheproductwhenmovingortransportingit.movingtheprinterthissectionexplainshowtomovetheprinterovershortdistances,suchastoadifferentlocationwithinthesamebuilding.makethefollowingpreparationsinadvancebeforemovingtheprinter.removeallpaperfromtheprinter.closeallcoversandstoretheejecttray.turnofftheprinterandremoveallcables.movetheprinter.turnontheprinter,performnozzlecheck,andthenperformcleaningifnecessary.transportingtheprinterwhentransportingtheprinter,transportitwhiletheinkpacks/maintenanceboxareinstalled.ifinkpackcannotbeinstalled,attachthetransportationcap(a)shownbelowontheinkpacktray(b)whentransportingtheprinter.nameaspnameaspcodetransportationcapcap,needle,inkpack1743970','23658142.html'];
